	row db 0
	stdraw dw 0
	stlimit dw 32000
.code
	;Iniciar segmento de datos
	MOV AX, SEG img
	MOV DS, AX
	
	;Establecer modo grafico
	MOV AL, 13h
	MOV AH, 00h
	INT 10h
	
	;Poner segmento extra en memoria de video
	MOV AX, 0A000h
	MOV ES, AX
	
	BCLEDRAW:
	
	MOV SI, stdraw
	MOV DI, 80
	BCLE:
		BCLF:			
			MOV AL, img[SI]
			MOV ES:[DI], AL
			INC SI
			INC DI
			INC row
		CMP row, 160
		JB BCLF
		ADD DI, 160
		MOV row, 0
	CMP SI, stlimit
	JB BCLE
	
	MOV AH, 0
	INT 16h
	
	CMP AH, 01h
	JE SALIR
	CMP AH, 48h
	JNE NOGOUP
		SUB stdraw, 320
		SUB stlimit, 320
	NOGOUP:
	CMP AH, 50h
	JNE NOGODOWN
		ADD stdraw, 320
		ADD stlimit, 320
	NOGODOWN:
	
	JMP BCLEDRAW
	
	SALIR:
	
	;FInalizar el programa
	MOV AH, 4Ch
	INT 21h
end